import {
  init_esm_shims
} from "./chunk-WWCIODDN.js";

// Commands/General/commands.ts
init_esm_shims();
import { SlashCommandBuilder, EmbedBuilder, Colors } from "discord.js";
var command = {
  data: new SlashCommandBuilder().setName("commands").setDescription("Gibt alle Slash Commands des Bots wieder"),
  async execute(interaction, client) {
    const embed = new EmbedBuilder({
      title: "Slash Commands",
      description: `\`${client.commands.map((c, k) => `/${k} - ${c.data.description}`).sort().join("`\n\n`")}\``,
      color: Colors.Gold
    });
    await interaction.reply({ embeds: [embed] });
  }
};
var commands_default = command;
export {
  commands_default as default
};
